def convertToImage(string):
	return base64.b64decode(string)

def classifyAndSave(embedding,image,filename):
	embedding = np.array(eval(embedding))
	# image = convertToImage(image)

	maxVal=-1
	predictedAnimal=""
	for animalName,animalVector in dic.items():
		print(animalName,len(animalVector))
		# val = compare(embedding,animalVector)
		val = np.dot(embedding,animalVector)
		if val>maxVal:
			predictedAnimal=animalName

	if not os.path.exists("/home/sgirdher/Classification/"+predictedAnimal+"/"):
		os.makedirs("/home/sgirdher/Classification/"+predictedAnimal+"/")

	with open("/home/sgirdher/Classification/"+predictedAnimal+"/"+filename+".jpeg", "wb") as f:
		f.write(image)

	return predictedAnimal

def compare(embedding,data):
	a=-1
	for dataVector in data:
		a=max(a,np.dot(embedding,dataVector))
	return a

